package com.dilipsuthar.mvvmrecyclerview.repositories;

import android.arch.lifecycle.MutableLiveData;

import com.dilipsuthar.mvvmrecyclerview.models.NicePlace;

import java.util.ArrayList;
import java.util.List;

/**
 * Singleton pattern
 */
public class NicePlaceRepository {

    private static NicePlaceRepository instance;
    private ArrayList<NicePlace> dataSet = new ArrayList<>();

    public static NicePlaceRepository getInstance() {
        if (instance == null) {
            instance = new NicePlaceRepository();
        }
        return instance;
    }

    // Pretend to get data from a webservice or online source
    public MutableLiveData<List<NicePlace>> getNicePlaces() {
        setNicePlaces();

        MutableLiveData<List<NicePlace>> data = new MutableLiveData<>();
        data.setValue(dataSet);
        return data;
    }

    private void setNicePlaces() {
        dataSet.add(
                new NicePlace("data:image/jpeg;base64,",
                        "Paris")
        );

        dataSet.add(
                new NicePlace("data:image/jpeg;base64,",
                        "Taj Mahal")
        );

        dataSet.add(
                new NicePlace("data:image/jpeg;base64,",
                        "Havasu Falls")
        );
        dataSet.add(
                new NicePlace("data:image/jpeg;base64,",
                        "Trondheim")
        );
        dataSet.add(
                new NicePlace("data:image/jpeg;base64,",
                        "Portugal")
        );
        dataSet.add(
                new NicePlace("data:image/jpeg;base64,",
                        "Rocky Mountain National Park")
        );
        dataSet.add(
                new NicePlace("data:image/jpeg;base64,\"",
                        "Havasu Falls")
        );
        dataSet.add(
                new NicePlace("https://i.redd.it/k98uzl68eh501.jpg",
                        "Mahahual")
        );
        dataSet.add(
                new NicePlace("https://c1.staticflickr.com/5/4636/25316407448_de5fbf183d_o.jpg",
                        "Frozen Lake")
        );
        dataSet.add(
                new NicePlace("https://i.redd.it/obx4zydshg601.jpg",
                        "Austrailia")
        );
    }

}
